import Link from "next/link";
function Index(props) {
  const { text } = props;
  return (
    <>
      <h1>Test</h1>
      <Link href="/about">
        <h1>Response: {text}</h1>
        <a>Go to About!</a>
      </Link>
    </>
  );
}

Index.getInitialProps = async function() {
  const fetchData = await fetch("./api/test.js");
  const text = await fetchData.text();
  return { text };
};

export default Index;
